features.script:
let man = parcel.getFeatureById('pie') //Change id of your vox
let speed = 2 //change desired speed

let corner1 = parcel.getFeatureById('corner1') //corner1
let corner2 = parcel.getFeatureById('corner2') //corner2

//DO not edit ---------------------------------
let start

let x1 = corner1.position.x
let z1 = corner1.position.z
let x2 = corner2.position.x
let z2 = corner2.position.z

function isInParcel(x1,x2,x,z1,z2,z){
if(x > x1 && x < x2 &&
z > z1 && z < z2) {

return true
}
}

setInterval(function(){
if(start && !isInParcel(x1,x2,man.position.x,z1,z2,man.position.z) || !isInParcel(x1,x2,man.position.x,z1,z2,man.position.z)){
man.position.x = start.x;
man.position.z = start.z;
}else{
if(!start){
start = man.position;
}

console.log('uuid:', man.uuid);
man.rotation.y+= (Math.random()-0.5)*1.57;
let offsetX = (Math.random() * 2 - 1)* 0.1 * speed;
let offsetZ = (Math.random() * 2 - 1)* 0.1 * speed;
let coordx= man.position.x + offsetX
let coordz= man.position.z + offsetZ
man.position.x += offsetX
man.position.z += offsetZ

}
}, 5000)
